void Sound_Task(void){
	if(len){
		DAC_Out(*soundPt);
		soundPt++;
		len--;
	}
	else{
		NVIC_DIS0_R = 1<<19; // disable IRQ 19 in NVIC
	}
};

void Sound_Play(const uint8_t *pt, uint32_t count){
// write this
	len = count;
	soundPt = pt;
	NVIC_EN0_R = 1<<19;
};

void Sound_Init(void){
// write this
	len = 0;
	DAC_Init();
	Timer0_Init(&Sound_Task, 80000000/11000);
};

